import React, { useState } from 'react';

const Hangman = () => {
  const [selectedLetters, setSelectedLetters] = useState([]);
  const alphabets = Array.from({ length: 26 }, (_, index) => String.fromCharCode('A'.charCodeAt(0) + index));

  const renderAlphabets = (item, index) => (
    <div
      key={index}
      className="alphabet"
      onClick={() => handleAlphabetClick(item)}
      style={{
        color: selectedLetters.includes(item) ? 'red' : 'black',
        textDecoration: !selectedLetters.includes(item) ? 'none' : 'underline',
      }}
    >
      {item}
    </div>
  );

  const handleAlphabetClick = (item) => {
    if (!selectedLetters.includes(item)) {
      setSelectedLetters([...selectedLetters, item]);
    }
  };

  return (
    <div className="alphabetContainer">
      <div className="row">
        {alphabets.slice(0, 9).map((item, index) => renderAlphabets(item, index))}
      </div>
      <div className="row">
        {alphabets.slice(9, 18).map((item, index) => renderAlphabets(item, index + 9))}
      </div>
      <div className="row">
        {alphabets.slice(18).map((item, index) => renderAlphabets(item, index + 18))}
      </div>
    </div>
  );
};

export default Hangman;
